<script setup>
import { computed, onMounted, reactive, ref, watch } from 'vue'
import { getClocks, getClocksStatistic } from "@/api/index.js"
import dayjs from 'dayjs'
const state = reactive({
  steps: [],
})

const props = defineProps({
  selects: {
    type: Object,
    default: () => { },
  },
})

const formatDur = (item) => {
  return dayjs(item.endTime).diff(dayjs(item.beginTime), 'minutes')
}

watch(() => props.selects.id, (v) => {
  if (v) {
    getOptions()
  }
})

function convertSecondsToHours(seconds) {
  let hours = seconds / 3600;
  return hours.toFixed(2);
}

const timeTotal = ref(0)
const timeToday = ref(0)
const total = ref(0)
const totalToday = ref(0)

const getOptions = () => {
  getClocks({ pageSize: 1000, pageNum: 1 }).then(res => {
    state.steps = res.data
  })
  getClocksStatistic({}).then(res => {
    timeTotal.value = convertSecondsToHours(res.timeTotal) || 0
    timeToday.value = convertSecondsToHours(res.timeToday) || 0
    total.value = res.total || 0
    totalToday.value = res.totalToday || 0
  })
}

defineExpose({ getOptions })
</script>


